import React from 'react';
import Axios from 'axios';

class DeveloperinProject extends React.Component{
    constructor(props){
        super(props);
        this.state={data:[],err:0,name:""}
        this.getname=this.getname.bind(this);
        Axios.get(`http://localhost:3002/getdeveloperinproject/${this.props.id}`).then(res=>{
            this.setState({data:res.data.developers}) 
            })
    }
    getname(id){
        var name="";
            Axios.get(`http://localhost:3002/developerdetail/${id}`).then(res=>{
                name=res.data.name;
                return name;
            })
    }

    render(){
        const developers=this.state.data.map(i=>{
            return(
                <div style={{border:"1px solid black",width:"fit-content",height:"fit-content"}}>
                    <h1>ju</h1>
                </div>
            )
        })

        return(
           <h1>{developers}</h1>
        )
    }
}
export default DeveloperinProject;
